import React from "react";

export default function Appointment()
{
    let textArea = {
        rows: "10",
        columns: "20",
        alignItem: "center",
        margin: "10%",
        height: "300px",
        width: "80%",
    }
    return (
        <div>
            <label>You can contact us through following: </label>
            <br/>
            <textarea style={textArea}></textarea>
            <button action="mailto:kumarsainideepak32@gmail.com">Submit</button>
        </div>
    )
}
